webpackJsonp([0xf6afd824e883],{6738:function(e,t){e.exports={data:{post:{html:'<p>Just for the record, I won\'t be at the <a title="CeBIT - Homepage Englisch" href="http://www.cebit.de/homepage_e?x=1">CeBIT</a> this year, even though <a title="BlogMeet at CeBIT by Heiko Hebig | hebig.com" href="http://www.hebig.com/archives/001897.shtml">several Hamburg bloggers</a> will be atttending the world\'s largest cattle stampede, er, I mean computer and IT trade show in Hannover (insert gratuitous Hannover joke here). Funny, back when I was not in the industry, I used to go to CeBIT on my own nickel. Nowadays, even though my company exhibits there, I have no desire to join the herd. Moo.</p>',fields:{title:"CeBIT Optional",date:"16 Mar 2004",url:"https://papascott.de/2004-03-16-cebit-optional/"}}},pathContext:{slug:"/2004-03-16-cebit-optional/",prev:{fields:{title:"Tobias is looking for a German greenish kind of liberal New Labour party",date:"15 Mar 2004",slug:"/2004-03-15-tobias-is-looking-for-a-german-greenish-kind-of-liberal-new-labour-party/"}},next:{fields:{title:"Citizen Smash on Spain",date:"16 Mar 2004",slug:"/2004-03-16-citizen-smash-on-spain/"}}}}}});
